import logo from './logo.svg';
import './App.css';
import slive_1 from './assets/images/1988s_slive_1.jpg'
import slive_2 from './assets/images/1988s_slive_2.jpg'


function App() {
  return (
    <div className="App">
      <div>
        <h1>Let's flip a coin!</h1>
        <img src={slive_1} alt="" />
        <img src={slive_2} alt="" />

      </div>
    </div>
  );
}

export default App;
